import React from "react";
import { Button } from "react-bootstrap";

class InvNavBut extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            brand: "Ford",
            model: "Mustang",
            color: "red",
            year: 1964
        };
    }
    render() {
        return (
            <div>
                <Button variant="primary" size="lg" block>
                    Block level button
                    </Button>
                <Button variant="secondary" size="lg" block>
                    Block level button
                    </Button>
            </div>
        )}}

export default InvNavBut;
